import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import {Box, Container, ThemeProvider} from "@mui/material";

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);
root.render(
  <React.StrictMode>
          <Box>
              <App />
          </Box>
  </React.StrictMode>
);

